import React, { Component } from "react";
import "./Games.css";

class GamesPage extends Component {
  render() {
    return (
      <div className="games-control">
        <p>Share your own events!</p>
        <button className="btn">Create Game</button>
      </div>
    );
  }
}
export default GamesPage;
